import React, {useState} from "react";
import {Row, Col, Card, CardBody, CardHeader,} from "reactstrap";
import {ChevronDown, ChevronRight} from "react-feather";
import PlusButton from "../../../components/buttons/plusButton";
import EditButton from "../../../components/buttons/editButton";
import DeleteButton from "../../../components/buttons/deleteButton";
import Accordion from "../../../components/accordion/Accordion";
import {HelpCircle} from "react-feather";

function SubMenu(props) {
    // console.log("SDg")
    const [open, setOpen] = useState(false);

    function handleOpen() {
        setOpen(!open)
    }

    function Chevron(props) {
        if (props.data) {
            if (!open) {
                return <ChevronRight size={18} className="mr-2" onClick={() => handleOpen()}/>
            }
            return <ChevronDown size={18} className="mr-2" onClick={() => handleOpen()}/>
        }
        return <div></div>
    }

    return (
        <Accordion.AccordionItem
            render={() => (
                <CardHeader>
                                 <span aria-expanded="true" aria-disabled="false" aria-controls="1"
                                       className="primary mx-0 cursor-pointer">
                                    <h5>
                                       <HelpCircle size={24} strokeWidth={1}/>{" "}
                                        <span>Lorem ipsum dolor sit amet, consectetur adipiscing elit ?</span>
                                    </h5>
                                 </span>
                </CardHeader>
            )}
        >
            <CardBody>
                Lorem ipsum dolor sit amet, consectetur adipisicing elit. Doloribus sit maxime ipsam iusto illo
                quis rerum tempora soluta ratione quisquam, recusandae vel laboriosam illum quia vt
                exercitationem temporibus itaque. Corporis hic corrupti sequi ea repudiandae mollitia
                voluptates provident!
            </CardBody>
        </Accordion.AccordionItem>
    )


};

function groupTable(props) {
    if (props.data.length > 0) {
        return (
            <div className="tabs-vertical">
                <Nav tabs>
                    <NavItem>
                        <NavLink
                            className={classnames({
                                active: this.state.activeTab === "1"
                            })}
                            onClick={() => {
                                this.toggle("1");
                            }}
                        >
                            Demo Content
                        </NavLink>
                    </NavItem>
                    <NavItem>
                        <NavLink
                            className={classnames({
                                active: this.state.activeTab === "2"
                            })}
                            onClick={() => {
                                this.toggle("2");
                            }}
                        >
                            Example Content
                        </NavLink>
                    </NavItem>
                    <NavItem>
                        <NavLink
                            className={classnames({
                                active: this.state.activeTab === "3"
                            })}
                            onClick={() => {
                                this.toggle("3");
                            }}
                        >
                            Tab Content
                        </NavLink>
                    </NavItem>
                </Nav>
                <TabContent activeTab={this.state.activeTab}>
                    <TabPane tabId="1">
                        <Row>
                            <Col sm="12">
                                <h4>Tab 1 Contents</h4>
                                <p>Lemon drops pastry chocolate. Jujubes sweet roll tootsie roll. Oat cake donut bonbon chocolate croissant candy candy brownie. Wafer jelly beans jelly ice cream caramels. Cookie bonbon lemon drops cheesecake brownie cake macaroon sweet. Toffee pie icing candy ice cream croissant caramels jelly. Muffin jelly gummies icing cheesecake chocolate cake. Sweet chupa chups croissant pudding sesame snaps soufflé. Marzipan cotton candy jujubes halvah cheesecake. Cupcake wafer gummies croissant candy brownie jelly. Sweet wafer chocolate halvah.</p>
                            </Col>
                        </Row>
                    </TabPane>
                    <TabPane tabId="2">
                        <Row>
                            <Col sm="6">
                                <Card body>
                                    <CardTitle>Special Title Treatment</CardTitle>
                                    <CardText>
                                        With supporting text below as a natural lead-in to
                                        additional content.
                                    </CardText>
                                    <Button className="btn btn-success">Go somewhere</Button>
                                </Card>
                            </Col>
                            <Col sm="6">
                                <Card body>
                                    <CardTitle>Special Title Treatment</CardTitle>
                                    <CardText>
                                        With supporting text below as a natural lead-in to
                                        additional content.
                                    </CardText>
                                    <Button className="btn btn-danger">Go somewhere</Button>
                                </Card>
                            </Col>
                        </Row>
                    </TabPane>
                    <TabPane tabId="3">
                        <Row>
                            <Col sm="12">
                                <h4>Tab 3 Contents</h4>
                                <p>Lemon drops pastry chocolate. Jujubes sweet roll tootsie roll. Oat cake donut bonbon chocolate croissant candy candy brownie. Wafer jelly beans jelly ice cream caramels. Cookie bonbon lemon drops cheesecake brownie cake macaroon sweet. Toffee pie icing candy ice cream croissant caramels jelly. Muffin jelly gummies icing cheesecake chocolate cake. Sweet chupa chups croissant pudding sesame snaps soufflé. Marzipan cotton candy jujubes halvah cheesecake. Cupcake wafer gummies croissant candy brownie jelly. Sweet wafer chocolate halvah.</p>
                            </Col>
                        </Row>
                    </TabPane>
                </TabContent>
            </div>
        )

    } else {
        return <div></div>
    }
}

export default groupTable;
